var project_capstone=[];async function fetchData(){try{const response=await fetch("data.json"),data=await response.json();project_capstone=data,GenerateTitle()}catch(error){console.error("Error fetching data:",error)}}var currentIndex=0;function displayProject(index){var project=project_capstone[index];document.getElementById("title").innerHTML=project.title||"",document.getElementById("description").innerHTML=project.description,document.getElementById("developer_name").innerHTML=project.developer_name;var researchKeys=Object.keys(project);(researchKeys=researchKeys.filter(key=>"title"!==key&&"description"!==key)).forEach((key,i)=>{document.getElementById(key).innerHTML=`${project[key]}`,project.Methodology=project.Methodology.replace(/\n/g,"<br>"),project.Expected_Deliverables=project.Expected_Deliverables.replace(/\n/g,"<br>"),project.Timeline_and_Milestones=project.Timeline_and_Milestones.replace(/\n/g,"<br>")}),document.getElementById("currentIndexDisplay").innerHTML=currentIndex+1,document.getElementById("list-count").innerHTML=project_capstone.length}function GenerateTitle(){currentIndex<project_capstone.length?(displayProject(currentIndex),currentIndex++):(displayProject(currentIndex=0),currentIndex++)}fetchData();